import React from 'react'
import classes from './Counter.module.css'

const Counter = () => {
  return (
    <div className={classes.Counter}>
      <button className={classes.Sub}>-</button>
      <button className={classes.Add}>+</button>
    </div>
  )
}

export default Counter
